import axios from "axios";

class restAPI{
    async registrationBloodOrg(accountClass){
        try{
            const res = await axios.post('auth/organization/blood-registration', accountClass);
            return res;
        }
        catch(error){
            console.log(error)
        }
    }
}
export default new restAPI()
